/* fonts */
export const FontFamily = {
  rubik: "Rubik",
  dMSans: "DM Sans",
  poppins: "Poppins",
  manrope: "Manrope",
};
/* font sizes */
export const FontSize = {
  size_sm: 14,
  size_xl: 20,
  size_3xl: 22,
  size_base: 16,
  size_lg: 18,
  size_mini: 15,
  size_xs: 12,
  size_smi: 13,
  size_4xl: 23,
};
/* Colors */
export const Color = {
  white: "#fff",
  subTextGray: "#7c7c7c",
  color: "#383737",
  textColour: "#333",
  black: "#000",
  forestgreen: "#27aa41",
  darkGrey: "#d9d9d9",
  gainsboro_100: "rgba(223, 228, 235, 0.4)",
  aliceblue: "#e5f6ff",
  mediumslateblue: "#2f4eef",
  grey: "#f4f4f4",
  darkgray: "#a8a8a8",
};
/* Paddings */
export const Padding = {
  p_9xs: 4,
  p_12xs: 1,
  p_102xl: 121,
  p_mini: 15,
};
/* border radiuses */
export const Border = {
  br_xl: 20,
  br_base: 16,
  br_81xl: 100,
  br_11xl: 30,
  br_5xl: 24,
  br_12xs_8: 1,
  br_31xl: 50,
};
